Table({
    ChartItem: 2025 , 
    ItemFilter1 : "",
    ItemFilter2 : "", 
    ChartValue: 10})

ForAll(   
   Sequence( chart_yearly_h.Count_Years , chart_yearly_h.StartYear , 1 )
   , 
   {
       ChartItem : ThisRecord.Value
   }
)

If( _cmpt_selected_item = ThisItem.ChartItem , 
    Set(_cmpt_selected_item , Blank() )   ,
    Set(_cmpt_selected_item , ThisItem.ChartItem) 
) ; 

chart_yearly_h.OnSelect_Year()

IfError( 
    Sum(Filter( chart_yearly_h.Item_Chart , 

        If( 
            !IsBlank(chart_yearly_h.Item_Filter_2) && !IsBlank(chart_yearly_h.Item_Filter_1) , 
            ItemFilter2 =  chart_yearly_h.Item_Filter_2  && ItemFilter1 =  chart_yearly_h.Item_Filter_1 && ChartItem = ThisItem.ChartItem , 

            If( IsBlank(chart_yearly_h.Item_Filter_2) && !IsBlank(chart_yearly_h.Item_Filter_1)  , 
            ItemFilter1 =  chart_yearly_h.Item_Filter_1 && ChartItem = ThisItem.ChartItem ,

            If( IsBlank(chart_yearly_h.Item_Filter_2) && IsBlank(chart_yearly_h.Item_Filter_1) , 
            ChartItem = ThisItem.ChartItem

        )
        )
        )


), ChartValue )/Sum(chart_yearly_h.Item_Chart,ChartValue) , 0) * (Parent.Height*0.2)

If( chart_yearly_h.IsTrue_DarkMode , 
    If( IsBlank(_cmpt_selected_item) , 
        ColorValue("#ffffff"), 
        If( _cmpt_selected_item = ThisItem.ChartItem , 
        ColorValue("#ffffff"), ColorValue("#e5e5e5")
        )
    ), 
    If( IsBlank(_cmpt_selected_item) , 
        ColorValue("#222222"), 
        If( _cmpt_selected_item = ThisItem.ChartItem , 
        ColorValue("#222222"), ColorValue("#959595")
        )
    )
)
